angular.module("agil.servicios").factory("FieldViewer",["VistaColumnasAplicacion",function(t){return function(i,n){return{object:i,application_id:n,getKeys:function(){return Object.keys(this.object.configuracion)},updateObject:function(){var n=this.object;t.update({id_aplicacion:this.application_id},this.object,function(i){n.configuracion=JSON.parse(i.configuracion),n.crear=!1})},getConfiguration:function(){return this.object.configuracion}}}}]);